vku. Tato šablona bude sloužit jako záložní, když nelze najít konkrétnější šablonu (např. štítek: Pizza).','Displays a post archive when a specific date is visited (e.g., example.com/2023/).'=>'Zobrazí archiv příspěvků při návštěvě konkrétního data (např. domena.cz/2023/).','Displays a custom taxonomy archive. Like categories and tags, taxonomies have terms which you use to classify things. For example: a taxonomy named "Art" can have multiple terms, such as "Modern" and "18th Century." This template will serve as a fallback when a more specific template (e.g. Taxonomy: Art) cannot be found.'=>'Zobrazí vlastní archiv taxonomie. Stejně jako rubriky a štítky mají taxonomie termíny, které používáte ke klasifikaci věcí. Například: taxonomie s názvem „Umění“ může obsahovat více termínů, jako je „moderní“ a „18. století“. Tato šablona bude sloužit jako záložní v případě, že nelze najít konkrétnější šablonu (např. Taxonomy: Art).','Displays a post category archive. This template will serve as a fallback when a more specific template (e.g. Category: Recipes) cannot be found.'=>'Zobrazí archiv rubrik příspěvků. Tato šablona bude sloužit jako záložní, když nelze najít specifičtější šablonu (např. rubrika: Recepty).','Displays a single author\'s post archive. This template will serve as a fallback when a more specific template (e.g. Author: Admin) cannot be found.'=>'Zobrazí archiv příspěvků jednoho autora. Tato šablona bude sloužit jako záložní, když nelze najít konkrétnější šablonu (např. autor: Správce).','Displays any archive, including posts by a single author, category, tag, taxonomy, custom post type, and date. This template will serve as a fallback when more specific templates (e.g. Category or Tag) cannot be found.'=>'Zobrazuje jakýkoli archiv, včetně příspěvků od jednoho autora, rubriky, štítku, taxonomie, vlastního typu příspěvku a data. Tato šablona bude sloužit jako záložní, když nelze najít konkrétnější šablony (např. rubrika nebo štítek).','Displays a static page unless a custom template has been applied to that page or a dedicated template exists.'=>'Zobrazí statickou stránku, pokud na ni nebyla použita vlastní šablona nebo pokud neexistuje vyhrazená šablona.','Displays a single post on your website unless a custom template has been applied to that post or a dedicated template exists.'=>'Zobrazí jeden příspěvek na vašich webových stránkách, pokud na něj nebyla použita vlastní šablona nebo pokud neexistuje vyhrazená šablona.','Displays any single entry, such as a post or a page. This template will serve as a fallback when a more specific template (e.g. Single Post, Page, or Attachment) cannot be found.'=>'Zobrazí libovolnou jednotlivou položku, například příspěvek nebo stránku. Tato šablona bude sloužit jako záložní, když nelze najít konkrétnější šablonu (např. jeden příspěvek, stránka nebo příloha).','Displays your site\'s homepage, whether it is set to display latest posts or a static page. The Front Page template takes precedence over all templates.'=>'Zobrazuje úvodní stránku vašeho webu, ať už je nastavena na zobrazování nejnovějších příspěvků nebo statická stránka. Šablona přední stránky má přednost před všemi šablonami.','Displays the latest posts as either the site homepage or as the "Posts page" as defined under reading settings. If it exists, the Front Page template overrides this template when posts are shown on the homepage.'=>'Zobrazuje nejnovější příspěvky buď jako domovskou stránku webu, nebo jako vlastní stránku definovanou v nastavení čtení. Pokud existuje, šablona titulní stránky přepíše tuto šablonu, když se příspěvky zobrazují na titulní stránce.','Used as a fallback template for all pages when a more specific template is not defined.'=>'Používá se jako záložní šablona pro všechny stránky, když není definována specifičtější šablona.','Block pattern categoryTeam'=>'Tým','Block pattern categoryAbout'=>'O','Block pattern categoryPosts'=>'Příspěvky','Block pattern categoryBanners'=>'Banery','block keywo