avděpodobně není správně konfigurován pro odesílání e-mailů. <a href="%s">Získejte podporu pro obnovení hesla</a> (anglicky).','New version available.'=>'Je dostupná nová verze.','Could not insert term taxonomy into the database.'=>'Položku taxonomie se nepodařilo uložit do databáze.','<a href="%1$s" %2$s>Learn how to describe the purpose of the image%3$s</a>. Leave empty if the image is purely decorative.'=>'<a href="%1$s" %2$s>Popište smysl obrázku%3$s</a>. Nevyplňujte jestli je obrázek čistě dekorativní.','In this case, WordPress caught an error with one of your plugins, %s.'=>'V tomto případě WordPress zaznamenal chybu v jednom z používaných pluginů - %s.','In this case, WordPress caught an error with your theme, %s.'=>'V tomto případě, WordPress zaznamenal chybu v používané šabloně - %s.','Howdy!

WordPress has a built-in feature that detects when a plugin or theme causes a fatal error on your site, and notifies you with this automated email.
###CAUSE###
First, visit your website (###SITEURL###) and check for any visible issues. Next, visit the page where the error was caught (###PAGEURL###) and check for any visible issues.

###SUPPORT###

If your site appears broken and you can\'t access your dashboard normally, WordPress now has a special "recovery mode". This lets you safely login to your dashboard and investigate further.

###LINK###

To keep your site safe, this link will expire in ###EXPIRES###. Don\'t worry about that, though: a new link will be emailed to you if the error occurs again after it expires.

When seeking help with this issue, you may be asked for some of the following information:
###DEBUG###

###DETAILS###'=>'Zdravíme!

Od verze 5.2 je ve WordPressu nově vestavěná funkce, která automaticky detekuje pluginem nebo šablonou vzniklou závažnou chybu, a automaticky vás o ní upozorní do e-mailu.
###CAUSE###
Nejprve navštivte web (###SITEURL###) a zkontrolujte, zda neobsahuje nějaké chyby. Poté navštivte stránku, na které byla chyba zaznamenána (###PAGEURL###) a opět zkontrolujte zda-li obsahuje nějaké chyby.

###SUPPORT###

Pokud web není v pořádku a nemůžete se běžným způsobem přihlásit do administrace, můžete použít speciální „režim obnovení“. Tento režim umožní bezpečné přihlášení do administrace a možnost identifikace problému.

###LINK###

Aby byla zajištěna bezpečnost webu, odkaz je časově omezen do ###EXPIRES###. V případě vypršení odkazu a opětovného nalezení chyby, vám bude e-mailem zaslán nový odkaz.

Při hledání pomoci s tímto problémem, můžete být požádáni o některé z následujících informací:

